import React from 'react';
import Header from './Components/Header';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";

function App() {
  return (
    <div>
      <Router>
        <Header />

        <Switch>
            <Route exact path = "/"><h1 className = "font-bold text-2xl text-center">Beaches near you</h1> </Route>
            <Route exact path = "/advancesearch"><h1 className = "font-bold text-2xl">//Search page</h1> </Route>
            <Route exact path = "/promodiscount"><h1 className = "font-bold text-2xl">//Promo and discount page</h1> </Route>
            <Route exact path = "/setting"><h1 className = "font-bold text-2xl">//Setting page</h1> </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
